const Discord = require("discord.js");
const fs = require('fs');

var rectarray = globalVars('reactionRoleInf');

var reactionArray = [];
var emojiArray = [];
var roleArray = [];
var embedSettings = [];

const _this = this;

var errorCatch = 5;
var emojiTimerRe = 0;

var localEmoji;
var localEmojiG;
var interval;
var mainMessage;

let embedTemplate = {
    color: 0x0bd7d6,
    title: "Utwórz ogłoszenie",
    description: `Odpowiedz teraz, podając **tytuł** do ogłoszenia!`,
};

if (msg.guild.me.hasPermission('MANAGE_ROLES')) {
    if (msg.member.hasPermission('MANAGE_ROLES')) {
        msg.channel.send({
                embed: embedTemplate
            })
            .then(async (message) => {
                await msg.guild.roles.fetch(true);
                mainMessage = message;
                askQuestion(`Odpowiedz teraz, podając **tytuł**  do ogłoszenia!`).then((response) => {
                    embedSettings[0] = response.content;
                    askQuestion(`Odpowiedz teraz, podając **opis**  do ogłoszenia.`).then((response) => {
                        embedSettings[1] = response.content;
                            if (response.content.toLowerCase() != "anuluj") {
                                askQuestion(`Twój tytuł to **${embedSettings[0]}** a twój opis to: **${embedSettings[1]}**\n\nJeśli jesteś z tego zadowolony, prosimy o odpowiedź "**tak**".\nJeśli nie, proszę o odpowiedź "**anuluj**".`).then((response) => {
                                    if (response.content.toLowerCase() == "tak") {
                                            reAsk(message, " ");
                                    } else {
                                        errorMessage('Zapytanie anulowane na prośbę użytkownika (brak odpowiedzi z „tak”).\nWykonaj ponownie polecenie, aby ponownie przejść dalej!', "Użytkownik nie odpowiedział potwierdzeniem opisu + Komunikat o potwierdzeniu tytułu");
                                    }
                                })
                            } else {
                                errorMessage("Operacja została anulowana na żądanie użytkownika.\nWykonaj ponownie polecenie, aby ponownie przejść dalej!", "Użytkownik odpowiedział anulowaniem, anulując w ten sposób operacje");
                            }  
                        })
                    })
                })
    } else {
        errorMessage("Nie masz uprawnień „ZARZĄDZAJ ROLAMI”, która jest wymagana do wykonania tego polecenia!", "Użytkownik nie ma uprawnień do wykonania polecenia.");
    }
} else {
    errorMessage("Bot nie ma uprawnienia „ZARZĄDZAJ ROLE”, które jest wymagane, aby bot mógł usuwać i dodawać role!", "Bot nie ma uprawnień do zarządzania rolami.")
}

function reAsk(message, extra) {
    if (extra == null) {
        extra = "";
    }
    askQuestion(`Jeśli wszystko się zgadza, w odpowiedzi podaj **wzmiankę** na **kanał tekstowy**, na który zostanie wysłane ogłoszenie.\nJeśli chcesz anulować operacje odpowiedz „**anuluj**”`).then((response) => {
        if (response.mentions.channels.first()) {
            var menchannel = response.mentions.channels.first()
            message.delete();
            menchannel.send({
                    embed: {
                        color: 0x0bd7d6,
                        title: embedSettings[0],
                        description: `${embedSettings[1]}`,
                    }
                });
        } else {
            errorMessage("Nie podałeś prawidłowego kanału!\nWykonaj ponownie polecenie, aby ponownie przejść dalej!", "Użytkownik nie odpowiedział prawidłowym kanałem i tym samym anulował operacje.", message);
        }
    });
}

function errorMessage(error, errorCause = "none") {

    if (debug) {
        console.log(errorCause);
    }

    if (mainMessage != null) {
        mainMessage.delete();
    }

    let errorTemplate = {
        color: 0x0bd7d6,
        title: "Utwórz ogłoszenie",
        description: error,
    };

    msg.channel.send({
        embed: errorTemplate
    });
}

function errorCheck(mainMessage, erMsgCatch, erMsgFail) {
    if (errorCatch > 0) {
        errorCatch -= 1;
        reAsk(mainMessage, erMsgCatch)
    } else {
        errorMessage(erMsgFail, "Użytkownikowi zabrakło prób i dlatego operacja zostaje anulowana.", mainMessage);
    }
}


function askQuestion(question) {
    return new Promise(function(resolve, reject) {
        embedTemplate["description"] = question;
        mainMessage.edit({
            embed: embedTemplate
        });
        msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
                max: 1,
                time: 120000,
                errors: ['time'],
            })
            .then(function(collected) {
                msg.author.lastMessage.delete();
                resolve(collected.first());
            }).catch((error) => {
                errorMessage('Przepraszamy, nie podałeś prawidłowej odpowiedzi na czas!\nWykonaj ponownie polecenie, aby ponownie przejść dalej!', error);
            });
    })

}
